import requests
import concurrent.futures
import time
# import json

# Your EC2 instance's FastAPI URL
url = 'http://localhost:8000'

def get_token(auth_url, username, password):
    response = requests.post(auth_url, data={"username": username, "password": password})
    if response.status_code == 200:
        return response.json().get('access_token')  # Replace 'access_token' with the key used by your API
    else:
        raise Exception(f"Authentication failed: {response.status_code}, {response.text}")

# Use the function to get your token
token = get_token("http://localhost:8000/auth/jwt/login", "user@example.com", "string")
print(f"Your token is: {token}")


# Replace 'your_token_here' with the actual token you receive after authentication
headers = {
    "Authorization": f"Bearer {token}"
}

# Function to send a GET request and print response time and status
def send_get_request(url, headers):
    start = time.time()
    response = requests.get(url, headers=headers)
    end = time.time()
    print(f'GET Request: {response.status_code}, Time: {end - start:.4f} seconds')
    print(f'Response: {response.json()}')
    if response.status_code != 200:
        print(f'Failed Request: {response.text}')
    return response.status_code, end - start

# Function to send a POST request and print response time and status
def send_post_request(url, data, headers):
    start = time.time()
    response = requests.post(url, json=data, headers=headers)
    end = time.time()
    print(f'POST Request: {response.status_code}, Time: {end - start:.4f} seconds')
    print(f'Response: {response.json()}')
    if response.status_code != 200:
        print(f'Failed Request: {response.text}')
    return response.status_code, end - start

# Function to make simultaneous GET requests using ThreadPoolExecutor
def make_get_requests_simultaneous(n, api_endpoint):
    times = []
    status_codes = []
    with concurrent.futures.ThreadPoolExecutor() as executor:
        futures = [executor.submit(send_get_request, f'{url}{api_endpoint}', headers) for _ in range(n)]
        for future in concurrent.futures.as_completed(futures):
            status_code, request_time = future.result()
            times.append(request_time)
            status_codes.append(status_code)
    avg_time = sum(times) / len(times)
    print(f'Average time for {n} GET requests: {avg_time:.4f} seconds')

# Function to make simultaneous POST requests using ThreadPoolExecutor
def make_post_requests_simultaneous(n, api_endpoint, data):
    times = []
    status_codes = []
    with concurrent.futures.ThreadPoolExecutor() as executor:
        futures = [executor.submit(send_post_request, f'{url}{api_endpoint}', data, headers) for _ in range(n)]
        for future in concurrent.futures.as_completed(futures):
            status_code, request_time = future.result()
            times.append(request_time)
            status_codes.append(status_code)
    avg_time = sum(times) / len(times)
    print(f'Average time for {n} POST requests: {avg_time:.4f} seconds')


